import React from 'react';
import Product from './Product.js'
import vschoolProducts from './vschoolProducts.js'


function App() {

    const productComponents = vschoolProducts.map(item => {
            return( 
                <Product key={item} product={item} />
                )
            })
    return(
        <div>
            {productComponents}
        </div>
    )
}
export default App;
